import React, { Component } from "react"

class Box extends Component {
    style = {
        backgroundColor: props.color,
        width: props.width + "px",
        height: props.height + "px"
    }
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div style={this.style} />
        )
    }
}

export default Box
